import './index.css'
function App() {
  const Users = ["Medamine" , "Ahmed" , "Issam" , "Bachar lahaywan"]
  const UserList = Users.map((user , index) => <li>{user}</li>)
  return  (
    <>
      <h1>This Is My list</h1>
      <ul>
        {UserList}
      </ul>
    </>
  )
}

export default App;
